// src/data/eventsData.js
const eventsData = [
    {
        title: "Party",
        description: "Makeup looks perfect for an evening party, night out, or celebration.",
        makeupStyles: ["Bold Lips", "Glitter Eyeshadow", "Smokey Eyes"]
    },
    {
        title: "Office",
        description: "Subtle and professional makeup for everyday office wear.",
        makeupStyles: ["Nude Lipstick", "Natural Blush", "Simple Eyeliner"]
    },
    {
        title: "Wedding",
        description: "Elegant and glamorous looks perfect for your big day or attending a wedding.",
        makeupStyles: ["Red Lipstick", "Shimmery Eyeshadow", "Contoured Cheeks"]
    }
];

export default eventsData;
